svg.script:
   
	var myMapApp = new mapApp(false, undefined); //与tooltip相关
    var obc; //
	var ocls;
    window.onSVGLoad = initLater();
    function initLater() {
        //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
        window.setTimeout("init()", 100);
    }
    function init() {

         /* 添加tooltip*/
         //tooltip styles
         var tooltipTextStyles = {
             "font-family": "Arial,Helvetica",
            "fill": "dimgray",
            "font-size": 130
        };
        var tooltipRectStyles = {
             "fill": "white",
            "stroke": "dimgray"
        };
         myMapApp.initTooltips("toolTip", tooltipTextStyles, tooltipRectStyles, 10, 20, 3);
         //add tooltip to element
         myMapApp.addTooltip("lunkuo", undefined, true, false, "target", "name");

    }
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.getAttribute("class") || object.className;
         var objectMap = svgDoc.getElementById(cls);
		  ocls = objectMap.getAttribute("class") || objectMap.className;
         objectMap.setAttribute("class","fil100 str190");
   }
   function Recover(evt) {
         var obj = evt.target;
         var cls = obj.getAttribute("class") || object.className;
         var objectMap = svgDoc.getElementById(cls);
         objectMap.setAttribute("class", ocls);
	}
	function Closecircle(n) {

         svgDoc.getElementById("circle" + n).setAttribute("style", "visibility: visible");
    }
	function tip(evt) {
         var obj = evt.target;
         obj.setAttribute("style", "fill: #000000");
         obj.setAttribute("fill-opacity", "0.5");
	}
    function tipclose(evt) {
         var obj = evt.target;
         obj.setAttribute("style", "fill: #FEFEFE");
         objectMap.setAttribute("fill-opacity", "0");
	}
